<td>Handle requests from first POST endpoint. Use the validate_input() function to check the request data, if the condition is not met, return the message &quot;invalid input&quot;. Check if poolId already exists. If poolId does not exist, create() will be used and return &quot;inserted&quot; message. If poolId already exists, use update() and return &quot;appended&quot; message.</td>
